import { Link } from "react-router-dom";

function Products() {
  const style = { "text-align": "center" };
  return (
    <>
      <div style={style}>My Products Page</div>
      <ul>
        <li>Product 1</li>
        <li>Product 2</li>
        <li>Product 3</li>
      </ul>
    </>
  );
}

export default Products;
